// src/pages/Events.js

import React, { useState } from "react";
import Calender from "../components/Calender"; // Ensure this path is correct
import './Events.css'; // This path should work since it's in the same folder

const Events = () => {
  const [date, setDate] = useState(new Date());
  
  const onDateChange = (newDate) => {
    setDate(newDate);
  };

  return (
    <div className="main-container">
      <Calender date={date} onDateChange={onDateChange} />
      <div className="filters">
        {/* Filters UI goes here */}
        <h2>Filters</h2>
        <div className="filter-card">
          {/* Example filter card */}
          <button>Filter 1</button>
          <button>Filter 2</button>
        </div>
      </div>
      <div className="event-cards">
        {/* Event cards go here */}
        <div className="dispEvent">Event 1</div>
        <div className="dispEvent">Event 2</div>
        <div className="dispEvent">Event 3</div>
      </div>
    </div>
  );
};

export default Events;
